import React from 'react';
import { Link } from 'react-router-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faWifi, faTv, faPhone } from '@fortawesome/free-solid-svg-icons';
import './HomePage-Style.css';

const HomePage = () => {
  return (
    <div>
      <header>
        <FontAwesomeIcon icon="far fa-crown" />      
        <h1>KaPN Customer List</h1>
      </header>
      <section>
        <h2>Explore Our Customer list</h2>
        <div className="service-items">
          <CustomerList/>

        </div>
      </section>
      <footer>
        <p>&copy; {new Date().getFullYear()} KaPN. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default HomePage;
